INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1106029, 1106, 'query', 'select report_node_master.channel_category_v as channel, report_node_master.region_v as region, report_node_master.area_v as area, report_node_master.sales_area_v as salesarea, report_node_master.cluster_v as cluster, report_node_master.micro_cluster_v as microcluster, null as additionalterritory, report_node_master.org_short_code_v as territoryid, report_node_master.sub_org_type_name_v as suborgtype, report_node_master.org_id_n::text as organizationid, report_node_master.org_short_code_v as orgshortcode, report_node_master.org_name_v as organizationname, report_product_master.brand_name_v as productbrand, null as producttype, report_product_master.product_category_name_v as productcategory, report_product_master.product_id_n::text as productid, report_product_master.product_code_v as productextid, report_product_master.product_name_v as productname, greatest(groupby_query_results.qty_n,0) as qty, groupby_query_results.avg_qty_n as avgqty, case when (groupby_query_results.avg_qty_n is not null and groupby_query_results.avg_qty_n != 0) then round(groupby_query_results.qty_n/groupby_query_results.avg_qty_n,0) end as businessdays from (select daily_stock_ledger.day_id_n as day_id_n, daily_stock_ledger.org_id_n as org_id_n, daily_stock_ledger.node_id_n as node_id_n, daily_stock_ledger.metrics_id_n as metrics_id_n, report_node_master.aggregation_id_n as actor_id_n, sum(daily_stock_ledger.closing_stock_qty_n) as qty_n, case when (sum(activation.dimension_1_n) is not null and sum(activation.dimension_1_n) != 0) then round((sum(daily_stock_ledger.closing_stock_qty_n)/count(distinct(activation.day_id_n))),0) else case when (sum(sellout.dimension_1_n) is not null and sum(sellout.dimension_1_n) != 0) then round((sum(daily_stock_ledger.closing_stock_qty_n)/count(distinct(sellout.day_id_n))),0) else null end end as avg_qty_n from kpi.tr_daily_stock_ledger as daily_stock_ledger inner join kpi.ms_report_node_master as report_node_master on (daily_stock_ledger.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and report_node_master.org_id_n = daily_stock_ledger.org_id_n and report_node_master.node_id_n = daily_stock_ledger.node_id_n) left join kpi.tr_daily_event_metrics_aggr as activation on (activation.day_id_n between (select to_char((select to_date(to_char(daily_stock_ledger.day_id_n,''99999999''),''yyyymmdd'') - interval ''8 days''),''yyyymmdd'')::numeric) and daily_stock_ledger.day_id_n and activation.event_type_n = 6 and activation.metrics_type_n = 13 and activation.actor_id_n = report_node_master.aggregation_id_n and activation.source_id_n = report_node_master.org_aggr_id_n and activation.metrics_id_n = daily_stock_ledger.metrics_id_n) left join kpi.tr_daily_event_metrics_aggr as sellout on (sellout.day_id_n between (select to_char((select to_date(to_char(daily_stock_ledger.day_id_n,''99999999''),''yyyymmdd'') - interval ''8 days''),''yyyymmdd'')::numeric) and daily_stock_ledger.day_id_n and sellout.event_type_n = 3 and sellout.metrics_type_n = 13 and sellout.actor_id_n = report_node_master.aggregation_id_n and sellout.source_id_n = report_node_master.org_aggr_id_n and sellout.metrics_id_n = daily_stock_ledger.metrics_id_n) group by daily_stock_ledger.day_id_n, daily_stock_ledger.org_id_n, daily_stock_ledger.node_id_n, daily_stock_ledger.metrics_id_n, report_node_master.aggregation_id_n ) as groupby_query_results inner join kpi.ms_report_node_master as report_node_master on (report_node_master.aggregation_id_n = groupby_query_results.actor_id_n) inner join kpi.ms_report_product_master as report_product_master on (report_product_master.product_id_n = groupby_query_results.metrics_id_n) limit 0', now());
