INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1107029, 1107, 'query', 'select report_day_master.date_v as datetime, null as channel, report_network_master.region_v as region, report_network_master.area_v as area, report_network_master.sales_area_v as salesarea, report_network_master.cluster_v as cluster, report_network_master.micro_cluster_v as microcluster, null as additionalterritory, report_network_master.territory_code_v as territoryid, report_network_master.poi_type_name_v as poitype, null as poicategories, null as poiradiusrange, report_network_master.poi_id_n::text as poiid, report_network_master.poi_name_v as poiname, null as additionalinformation, site_master.lookup_id_n::text as siteid, site_master.lookup_name_v::text as sitename, report_network_master.bts_type_n::text as btstype, null as lac_des, null as cell_des, groupby_query_results.revenue_value as revenuevalue from (select daily_upload_metrics_aggr.day_id_n as day_id_n, daily_upload_metrics_aggr.event_type_n as event_type_n, daily_upload_metrics_aggr.actor_id_n as actor_id_n, round(sum((daily_upload_metrics_aggr.dimension_1_n)/100),2) as revenue_value from kpi.tr_daily_upload_metrics_aggr as daily_upload_metrics_aggr where daily_upload_metrics_aggr.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and daily_upload_metrics_aggr.actor_type_n = 8 and daily_upload_metrics_aggr.event_type_n = 102 and daily_upload_metrics_aggr.metrics_type_n in (21) group by daily_upload_metrics_aggr.day_id_n, daily_upload_metrics_aggr.event_type_n, daily_upload_metrics_aggr.actor_id_n order by day_id_n desc ) as groupby_query_results inner join kpi.ms_report_network_master as report_network_master on (groupby_query_results.actor_id_n = report_network_master.aggregation_id_n) inner join kpi.ms_lookup_master as site_master on (report_network_master.site_id_n = site_master.lookup_id_n::character varying and site_master.lookup_type_n = (select lookup_type_n from kpi.ms_lookup_type_master where ext_lookup_type_n = 115)) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
