) inner join kpi.ms_metrics_master as reload_system on (groupby_query_results.instance_id_n = reload_system.metrics_id_n) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
