INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1111029, 1111, 'query', 'select report_day_master.date_v as date, null as channel, report_network_master.region_v as region, report_network_master.area_v as area, report_network_master.sales_area_v as salesarea, report_network_master.cluster_v as cluster, report_network_master.micro_cluster_v as microcluster, null as additionalterritory, report_network_master.territory_code_v as territoryid, report_network_master.lac_id_v as lacid, report_network_master.cell_id_v as cellid, reload_system.metrics_name_v as systemsource, null as denomination, groupby_query_results.reload_count as reloadcount, groupby_query_results.reload_value as reloadvalue from (select daily_upload_metrics_aggr.day_id_n as day_id_n, daily_upload_metrics_aggr.event_type_n as event_type_n, daily_upload_metrics_aggr.actor_id_n as actor_id_n, daily_upload_metrics_aggr.source_id_n as source_id_n, daily_upload_metrics_aggr.instance_type_n as instance_type_n, daily_upload_metrics_aggr.instance_id_n as instance_id_n, round((sum(daily_upload_metrics_aggr.dimension_1_n)/100),0) as reload_count, round((sum(daily_upload_metrics_aggr.dimension_2_n)/100),2) as reload_value from kpi.tr_daily_upload_metrics_aggr as daily_upload_metrics_aggr where daily_upload_metrics_aggr.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and daily_upload_metrics_aggr.event_type_n = 108 and daily_upload_metrics_aggr.metrics_type_n in (30) group by daily_upload_metrics_aggr.day_id_n, daily_upload_metrics_aggr.event_type_n, daily_upload_metrics_aggr.actor_id_n, daily_upload_metrics_aggr.source_id_n, daily_upload_metrics_aggr.instance_type_n, daily_upload_metrics_aggr.instance_id_n order by day_id_n desc ) as groupby_query_results inner join kpi.ms_report_network_master as report_network_master on (groupby_query_results.actor_id_n = report_network_master.aggregation_id_n) inner join kpi.ms_metrics_master as reload_system on (groupby_query_results.instance_id_n = reload_system.metrics_id_n) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
