INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1113029, 1113, 'query', 'select report_day_master.date_v as date, null as channel, report_network_master.region_v as region, report_network_master.area_v as area, report_network_master.sales_area_v as salesarea, report_network_master.cluster_v as cluster, report_network_master.micro_cluster_v as microcluster, null as additionalterritory, report_network_master.territory_code_v as territoryid, report_network_master.lac_id_v as lacid, report_network_master.cell_id_v as cellid, system_source.metrics_name_v as systemsource, null as sid, null as smstext, report_product_master.product_code_v as packagecode, report_product_master.product_name_v as packagename, groupby_query_results.activation_qty as qty, groupby_query_results.activation_value as amount from (select daily_upload_metrics_aggr.day_id_n as day_id_n, daily_upload_metrics_aggr.event_type_n as event_type_n, daily_upload_metrics_aggr.actor_id_n as actor_id_n, daily_upload_metrics_aggr.metrics_type_n as metrics_type_n, daily_upload_metrics_aggr.metrics_id_n as metrics_id_n, daily_upload_metrics_aggr.instance_id_n as instance_id_n, round(sum((daily_upload_metrics_aggr.dimension_1_n)/100),2) as activation_qty, round(sum((daily_upload_metrics_aggr.dimension_2_n)/100),2) as activation_value from kpi.tr_daily_upload_metrics_aggr as daily_upload_metrics_aggr where daily_upload_metrics_aggr.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and daily_upload_metrics_aggr.actor_type_n = 8 and daily_upload_metrics_aggr.event_type_n = 105 and daily_upload_metrics_aggr.metrics_type_n in (44) group by daily_upload_metrics_aggr.day_id_n, daily_upload_metrics_aggr.event_type_n, daily_upload_metrics_aggr.actor_id_n,daily_upload_metrics_aggr.metrics_type_n, daily_upload_metrics_aggr.metrics_id_n, daily_upload_metrics_aggr.instance_id_n order by day_id_n desc ) as groupby_query_results inner join kpi.ms_report_network_master as report_network_master on (groupby_query_results.actor_id_n = report_network_master.aggregation_id_n) inner join kpi.ms_metrics_master as system_source on (groupby_query_results.instance_id_n = system_source.metrics_id_n and system_source.metrics_type_n = 31) inner join kpi.ms_report_product_master as report_product_master on (groupby_query_results.metrics_id_n = report_product_master.product_id_n) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
