INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1114029, 1114, 'query', 'select report_day_master.date_v as date, report_org_master.region_v as region, report_org_master.area_v as area, report_org_master.sales_area_v as salesarea, report_org_master.cluster_v as cluster, report_org_master.micro_cluster_v as microcluster, revenue_category.metrics_name_v as revenuecategory, revenue_type.metrics_name_v as revenuetype, groupby_query_results.revenue as revenue from (select daily_upload_metrics_aggr.day_id_n as day_id_n, daily_upload_metrics_aggr.event_type_n as event_type_n, daily_upload_metrics_aggr.actor_id_n as actor_id_n, daily_upload_metrics_aggr.source_id_n as source_id_n, daily_upload_metrics_aggr.metrics_type_n as metrics_type_n, daily_upload_metrics_aggr.metrics_id_n as metrics_id_n, daily_upload_metrics_aggr.instance_id_n as instance_id_n, round((sum(daily_upload_metrics_aggr.dimension_2_n)/100),2) as revenue from kpi.tr_daily_upload_metrics_aggr as daily_upload_metrics_aggr where daily_upload_metrics_aggr.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and daily_upload_metrics_aggr.event_type_n = 106 and daily_upload_metrics_aggr.metrics_type_n in (37, 40) group by daily_upload_metrics_aggr.day_id_n, daily_upload_metrics_aggr.event_type_n, daily_upload_metrics_aggr.actor_id_n, daily_upload_metrics_aggr.source_id_n, daily_upload_metrics_aggr.metrics_type_n, daily_upload_metrics_aggr.metrics_id_n, daily_upload_metrics_aggr.instance_id_n order by day_id_n desc ) as groupby_query_results inner join kpi.ms_report_org_master as report_org_master on (groupby_query_results.source_id_n = report_org_master.aggregation_id_n) inner join kpi.ms_metrics_master as revenue_type on (groupby_query_results.metrics_id_n = revenue_type.metrics_id_n and revenue_type.metrics_type_n = 37) left join kpi.ms_metrics_master as revenue_category on (groupby_query_results.instance_id_n = revenue_category.metrics_id_n and revenue_category.metrics_type_n = 40) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
