INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1116029, 1116, 'query', 'select report_day_master.date_v as date, report_user_master.user_id_n::text as userid, report_user_master.user_name_v as username, report_user_master.org_short_code_v as saldomoborefcode, report_user_master.region_v as region, report_user_master.area_v as area, report_user_master.sales_area_v as salesarea, report_user_master.cluster_v as cluster, report_user_master.micro_cluster_v as microcluster, null as additionalterrtirory, metrics_master.metrics_name_v as kpiname, groupby_query_results.targetperiod as targetperiod, groupby_query_results.achievement as achievement, groupby_query_results.target as target, groupby_query_results.achievementpercent as achievementpercent, groupby_query_results.result as result from (select daily_upload_aggr.day_id_n as day_id_n, daily_upload_aggr.event_type_n as event_type_n, daily_upload_aggr.actor_type_n as actor_type_n, daily_upload_aggr.actor_id_n as actor_id_n, daily_upload_aggr.metrics_type_n as metrics_type_n, daily_upload_aggr.metrics_id_n as metrics_id_n, ''Period-''||daily_target_aggr.data_flag_n::text as targetperiod, case when sum(daily_target_aggr.achievement_n) is not null then round((sum(daily_target_aggr.achievement_n)/100),2) else round((sum(daily_upload_aggr.dimension_1_n)/100),2) end as achievement, round((sum(daily_target_aggr.target_n)/100),2) as target, round((sum(daily_target_aggr.percentage_n)/100),2) as achievementpercent, case when (sum(daily_target_aggr.status_flag_n) is not null) then case when (sum(daily_target_aggr.status_flag_n) > 0) then ''Success'' else ''Failure'' end else null end as result from kpi.tr_daily_upload_metrics_aggr as daily_upload_aggr left join kpi.tr_daily_target_metrics_aggr as daily_target_aggr on (daily_target_aggr.day_id_n = daily_upload_aggr.day_id_n and daily_target_aggr.event_type_n = daily_upload_aggr.event_type_n and daily_target_aggr.metrics_type_n = daily_upload_aggr.metrics_type_n and daily_target_aggr.metrics_id_n = daily_upload_aggr.metrics_id_n and daily_target_aggr.actor_type_n = daily_upload_aggr.actor_type_n and daily_target_aggr.actor_id_n = daily_upload_aggr.actor_id_n and daily_target_aggr.description_v ilike ''achievement'') where daily_upload_aggr.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and daily_upload_aggr.event_type_n = 100 group by daily_upload_aggr.day_id_n, daily_upload_aggr.event_type_n, daily_upload_aggr.metrics_type_n, daily_upload_aggr.metrics_id_n, daily_upload_aggr.actor_type_n, daily_upload_aggr.actor_id_n, daily_target_aggr.data_flag_n order by daily_upload_aggr.day_id_n desc ) as groupby_query_results inner join kpi.ms_metrics_master as metrics_master on (groupby_query_results.metrics_id_n = metrics_master.metrics_id_n) inner join kpi.ms_report_user_master as report_user_master on (report_user_master.node_aggr_id_n = groupby_query_results.actor_id_n) inner join kpi.ms_report_day_master as report_day_master on (report_day_master.day_id_n = groupby_query_results.day_id_n)', now());
