INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1122029, 1122, 'query', 'select report_day_master.date_dt as date, report_day_master.month_v as month, report_day_master.year_v as year, report_user_master.channel_category_v as channelcategory, report_user_master.region_v as region, report_user_master.area_v as area, report_user_master.sales_area_v as salesarea, report_user_master.cluster_v as cluster, report_user_master.micro_cluster_v as microcluster, null as additionalterritory, report_user_master.sub_org_type_name_v as suborgtype, report_user_master.org_short_code_v as orgshortcode, report_user_master.org_name_v as organization, report_user_master.position_name_v as position, report_user_master.node_id_n::text as nodeid, report_user_master.node_name_v as nodename, report_user_master.operator_type_v as operatortype, report_user_master.operator_id_v as operatorid, report_user_master.user_name_v as username, report_user_master.operator_name_v as operatorname, user_activition_aggr.activitionqty as activitionqty, user_activition_aggr.selloutamount as selloutamount, null as tresholdreloadqty, sell_out_aggr.activitionamount as activitionamount, treshold_reload_aggr.tresholdreloadamount as tresholdreloadamount from (select true) as default_aggr left join ( select sell_out.day_id_n as day_id_n, sell_out.event_type_n as event_type_n, sell_out.metrics_type_n as metrics_type_n, sell_out.actor_id_n as actor_id_n, sell_out.source_id_n as source_id_n, sell_out.metrics_id_n as metrics_id_n, round(sum((sell_out.dimension_1_n)/100),0) as selloutqty, round(sum((sell_out.dimension_2_n)/100),2) as activitionamount from kpi.tr_daily_event_metrics_aggr as sell_out where sell_out.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and sell_out.event_type_n = 3 and sell_out.metrics_type_n in (13) group by day_id_n, event_type_n, metrics_type_n, actor_id_n,source_id_n, metrics_id_n ) as sell_out_aggr on (true) left join ( select user_activition.day_id_n as day_id_n, user_activition.event_type_n as event_type_n, user_activition.metrics_type_n as metrics_type_n, user_activition.actor_id_n as actor_id_n, user_activition.source_id_n as source_id_n, user_activition.metrics_id_n as metrics_id_n, round(sum((user_activition.dimension_1_n)/100),0) as activitionqty, round(sum((user_activition.dimension_2_n)/100),2) as selloutamount from kpi.tr_daily_event_metrics_aggr as user_activition where user_activition.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and user_activition.event_type_n = 6 and user_activition.metrics_type_n in (13) group by day_id_n, event_type_n, metrics_type_n, actor_id_n,source_id_n, metrics_id_n ) as user_activition_aggr on (true) left join ( select treshold_reload.day_id_n as day_id_n, treshold_reload.event_type_n as event_type_n, treshold_reload.metrics_type_n as metrics_type_n, treshold_reload.actor_id_n as actor_id_n, treshold_reload.source_id_n as source_id_n, treshold_reload.metrics_id_n as metrics_id_n, round(sum((treshold_reload.dimension_1_n)/100),2) as tresholdreloadamount from kpi.tr_daily_upload_metrics_aggr as treshold_reload where treshold_reload.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and treshold_reload.event_type_n = 109 and treshold_reload.metrics_type_n in (13) group by day_id_n, event_type_n, metrics_type_n, actor_id_n,source_id_n, metrics_id_n ) as treshold_reload_aggr on (true) inner join kpi.ms_report_user_master as report_user_master on (report_user_master.org_aggr_id_n in (sell_out_aggr.source_id_n) and report_user_master.node_aggr_id_n = user_activition_aggr.actor_id_n and report_user_master.aggregation_id_n in(treshold_reload_aggr.source_id_n,sell_out_aggr.actor_id_n)) inner join kpi.ms_report_day_master as report_day_master on (report_day_master.day_id_n in(sell_out_aggr.day_id_n, treshold_reload_aggr.day_id_n))', now());
