INSERT INTO INTERFACE.MS_INTERFACE_ATTR (ATTRIBUTE_ID_N, INTERFACE_ID_N, NAME_V, VALUE_V, LAST_UPDATED_TIME_DT) VALUES (1124029, 1124, 'query', 'select report_day_master.date_v as date, report_org_master.channel_category_v as channel, report_network_master.region_v as region, report_network_master.area_v as area, report_network_master.sales_area_v as salesarea, report_network_master.cluster_v as cluster, report_network_master.micro_cluster_v as microcluster, groupby_query_results.territoryid as territoryid, null as additionalterritory, report_product_master.product_code_v as physicalproductcode, report_product_master.product_category_name_v as physicalproductcategory, report_product_master.product_name_v as physicalproductname, groupby_query_results.territorycrossellingtype as territorycrossellingtype, null as totalvalue, groupby_query_results.totalqty as totalqty, null as crossellingactivationvalue, groupby_query_results.crossellingactivationqty as crossellingactivationqty, null as inneractivationvalue, groupby_query_results.inneractivationqty as inneractivationqty from (select daily_event_metrics_aggr.day_id_n as day_id_n, daily_event_metrics_aggr.actor_id_n as actor_id_n, daily_event_metrics_aggr.event_type_n as event_type_n, daily_event_metrics_aggr.metrics_id_n as metrics_id_n, daily_event_metrics_aggr.metrics_type_n as metrics_type_n, daily_event_metrics_aggr.instance_type_n as instance_type_n, daily_event_metrics_aggr.instance_id_n as instance_id_n, daily_event_metrics_aggr.source_type_n as source_type_n, daily_event_metrics_aggr.source_id_n as source_id_n, daily_event_metrics_aggr.data_flag_n as data_flag_n, daily_crossell.instance_id_n as territorycrossellingtype, daily_crossell.instance_type_n as territoryid, round((sum(daily_not_crossell.dimension_1_n)/100),0) as inneractivationqty, round((sum(daily_crossell.dimension_1_n)/100),0) as crossellingactivationqty, round((sum(daily_event_metrics_aggr.dimension_1_n)/100),0) as totalqty from kpi.tr_daily_event_metrics_aggr as daily_event_metrics_aggr left join kpi.tr_daily_event_metrics_aggr as daily_crossell on (daily_event_metrics_aggr.day_id_n = daily_crossell.day_id_n and daily_crossell.data_flag_n in (1) ) left join kpi.tr_daily_event_metrics_aggr as daily_not_crossell on (daily_event_metrics_aggr.day_id_n = daily_not_crossell.day_id_n and daily_not_crossell.data_flag_n in (2) ) where daily_event_metrics_aggr.day_id_n = (select to_number(to_char(date(now() - interval ''1 day''),''yyyymmdd''),''99999999'')) and daily_event_metrics_aggr.event_type_n = 8 and daily_event_metrics_aggr.actor_type_n=8 and daily_event_metrics_aggr.metrics_type_n in (13) and daily_event_metrics_aggr.data_flag_n in (1, 2) group by daily_event_metrics_aggr.day_id_n, daily_event_metrics_aggr.actor_id_n, daily_event_metrics_aggr.event_type_n, daily_event_metrics_aggr.metrics_type_n, daily_event_metrics_aggr.metrics_id_n, daily_event_metrics_aggr.instance_type_n, daily_event_metrics_aggr.instance_id_n, daily_event_metrics_aggr.source_type_n, daily_event_metrics_aggr.source_id_n, daily_event_metrics_aggr.data_flag_n, daily_crossell.instance_id_n , daily_crossell.instance_type_n order by day_id_n desc ) as groupby_query_results inner join kpi.ms_report_org_master as report_org_master on (report_org_master.aggregation_id_n = groupby_query_results.source_id_n) inner join kpi.ms_report_product_master as report_product_master on (report_product_master.product_id_n = groupby_query_results.metrics_id_n) inner join kpi.ms_lookup_master as origin_cluster on ( groupby_query_results.instance_id_n = origin_cluster.lookup_id_n ) inner join kpi.ms_lookup_master as crossell_cluster on (groupby_query_results.instance_id_n = crossell_cluster.lookup_id_n and crossell_cluster.lookup_type_n = (select lookup_type_n from kpi.ms_lookup_master as lookup_master where lookup_master.lookup_id_n = groupby_query_results.instance_type_n)) inner join kpi.ms_report_network_master as report_network_master on ((groupby_query_results.actor_id_n = report_network_master.aggregation_id_n) or (origin_cluster.lookup_id_n = report_network_master.territory_id_n and origin_cluster.lookup_type_n = report_network_master.territory_type_n)) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
