_n, instance_id_n, source_type_n, source_id_n, data_flag_n order by day_id_n desc ) as groupby_query_results inner join kpi.ms_report_org_master as report_org_master on (report_org_master.aggregation_id_n = groupby_query_results.source_id_n) inner join kpi.ms_report_product_master as report_product_master on (groupby_query_results.metrics_id_n = report_product_master.product_id_n and report_product_master.product_category_id_n in (select metrics_id_n from kpi.ms_metrics_master where ext_metrics_id_v in (select unnest(string_to_array(property_value_v::text, '',''::text)::character varying[]) from kpi.ms_property_master where property_key_v ilike ''starter_pack_master''))) inner join kpi.ms_lookup_master as origin_cluster on ( groupby_query_results.instance_id_n = origin_cluster.lookup_id_n ) inner join kpi.ms_lookup_master as crossell_cluster on (groupby_query_results.instance_id_n = crossell_cluster.lookup_id_n and crossell_cluster.lookup_type_n = (select lookup_type_n from kpi.ms_lookup_master as lookup_master where lookup_master.lookup_id_n = groupby_query_results.instance_type_n)) inner join kpi.ms_report_network_master as report_network_master on ((groupby_query_results.actor_id_n = report_network_master.aggregation_id_n) or (origin_cluster.lookup_id_n = report_network_master.territory_id_n and origin_cluster.lookup_type_n = report_network_master.territory_type_n)) inner join kpi.ms_report_day_master as report_day_master on (groupby_query_results.day_id_n = report_day_master.day_id_n)', now());
